static void print_struct_cb_list (int indent, int ptr_uid, struct cb_list *ptr);
static void print_struct_cb_list_ptr (int indent, struct cb_list *ptr){
    int ptr_uid ;
    PRINT_STRUCT_PTR_TY("struct cb_list*");
    if (ptr == NULL){
       PRINT_NULL(indent,ty);
       return;
    }
    ptr_uid = is_known_ptr (ptr);
    if (ptr_uid < 0 ){
       ptr_uid = -ptr_uid;
       PRINT_STRUCT_KNOWN(indent, ty, ptr_uid);
       return;
    }
    print_struct_cb_list (indent, ptr_uid, ptr);
}

